function GetSheetNames(filename)
{
    var XLSX = require("xlsx");
    const result = [];

    if(filename.slice(-4) === "xlsx")
    {
        var workbook = XLSX.readFile(filename);

        workbook.SheetNames.forEach( row => {
            result.push( { label: row, value: row})
        });

        return result;
    }
    else
    {
        return result;
    }
}

//GetSheetNames("Example_Absences_(Fall_2017-018).xlsx");

exports.GetSheetNames = "GetSheetNames";
